export const resetEmsInboxList = () => {
  return {
    type: 'EMS_INBOX_LIST_RESET',
  };
};
export const resetEmsExistingDocuments = () => {
  return {
    type: 'EMS_EXISTING_DOCUMENTS_RESET',
  };
};
